query ShowArtistsQuery(
  $showID: String!
) {
  show(id: $showID) {
    ...ShowArtists_show
    __id
  }
}

fragment ShowArtists_show on Show {
  _id
  id
  artists_grouped_by_name {
    letter
    items {
      ...ArtistListItem_artist
      sortable_id
      href
      __id
    }
  }
  __id
}

fragment ArtistListItem_artist on Artist {
  __id
  _id
  id
  name
  is_followed
  nationality
  birthday
  deathday
  image {
    url
  }
}
